values:
I'm so glad summer is here! 
I've decided to keep this LJ around and will use it for more personal posts.&nbsp; Most posts will be related to plush love and the furry fandom.&nbsp; 

FAU was a great convention this year.&nbsp; Shy Matsi did a great job with the con suite and I got to see many old friends.&nbsp; It was great seeing Kuddlepup and rehashing some of the old pawpet show memories.&nbsp; I was close to winning the bid for Ezra's goggles in the charity auction but didn't speak up loud enough for my next bid to be heard!&nbsp; Ah well, it was all great fun.&nbsp; 

My fursuit from Lacy is half paid off.&nbsp; I must find ways to pay the rest off so I can finally get one.&nbsp; Conventions would be a lot more fun if i was able to perform in fursuit.&nbsp; I will be so nervous though.&nbsp; 

On the plush front, I recently just won a large Kiara plush off E-bay &quot;new&quot; with tags.&nbsp; I&nbsp;love the large felines lately.&nbsp; Now to find a Douglas Simba.&nbsp; And I'm supposed to be a wolf. &nbsp;What strong powers these ebil felines have over me!
